{"title":"Patterns male/female","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v5.json
  description: A simple radial chart with embedded data.
  data: {
    url: {
      index: patterns
      body: {
        size: 0
        aggs: {
          sex: {
            terms: {
              field: pattern_attributes.permalink.keyword
              include: [
                male
                female
                unisex
              ]
            }
          }
        }
      }
    }
    format: {
      property: aggregations.sex.buckets
    }
  }
  layer: [
    {
      mark: {
        type: arc
        innerRadius: 20
        stroke: "#fff"
      }
    }
    {
      mark: {
        type: text
        radiusOffset: 20
      }
      encoding: {
        text: {
          field: key
          type: nominal
        }
      }
    }
  ]
  encoding: {
    theta: {
      field: doc_count
      type: quantitative
      stack: true
    }
    radius: {
      field: doc_count
      scale: {
        type: sqrt
        zero: true
        rangeMin: 20
      }
    }
    color: {
      field: doc_count
      type: nominal
      legend: null
    }
  }
}"},"aggs":[]}
